import axios from "axios"
import { getapi } from "../constant"

const getResource = ()=>{
  let resp="";  

  resp = fetch(getapi)
  .then(response => response.json())
  .then(data => {
      console.log(data);
      resp = data
  });
  return resp;

}
export default getResource;
